		private void Read302(string[] lines)
		{
			CultureInfo culture = new CultureInfo("en-US");
			List<string> Llines = lines.ToList();
			Llines.RemoveAll(t => String.IsNullOrWhiteSpace(t) || t.StartsWith("["));
			int i = 0;

            Values.Add("Version.AppVersion", new PP3entry("Version.AppVersion", Llines[i].Substring(Llines[i].LastIndexOf("=") + 1), String.Empty, String.Empty)); i++;
			FileVersion = Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)); i++;
			Values.Add("General.Rank", new PP3entry("General.Rank", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), 0, 0)); i++;
			Values.Add("General.ColorLabel", new PP3entry("General.ColorLabel", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), 0, 0)); i++;
			Values.Add("General.InTrash", new PP3entry("General.InTrash", Convert.ToBoolean(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), false, true)); i++;
			Values.Add("Exposure.Auto", new PP3entry("Exposure.Auto", Convert.ToBoolean(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), false, true)); i++;
			Values.Add("Exposure.Clip", new PP3entry("Exposure.Clip", Convert.ToDouble(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1), culture), 0d, 1d)); i++;
			Compensation = Convert.ToDouble(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1), culture); i++;
			Values.Add("Exposure.Brightness", new PP3entry("Exposure.Brightness", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), -100, 100)); i++;
			Values.Add("Exposure.Contrast", new PP3entry("Exposure.Contrast", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), -100, 100)); i++;
			Values.Add("Exposure.Saturation", new PP3entry("Exposure.Saturation", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), -100, 100)); i++;
			Values.Add("Exposure.Black", new PP3entry("Exposure.Black", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), -16384, 32768)); i++;
			Values.Add("Exposure.HighlightCompr", new PP3entry("Exposure.HighlightCompr", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), 0, 500)); i++;
