			Values.Add("ChannelMixer.Red", new PP3entry("ChannelMixer.Red", PP3Curve.GetCurve(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), null, null)); i++;
			Values.Add("ChannelMixer.Green", new PP3entry("ChannelMixer.Green", PP3Curve.GetCurve(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), null, null)); i++;
			Values.Add("ChannelMixer.Blue", new PP3entry("ChannelMixer.Blue", PP3Curve.GetCurve(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), null, null)); i++;
			Values.Add("LuminanceCurve.Brightness", new PP3entry("LuminanceCurve.Brightness", Convert.ToInt32(Llines[i].Substring(Llines[i].LastIndexOf("=") + 1)), -100, 100)); i++;
